import React from 'react';

function Food({ name }) {
  return (
    <h1>I like {name}</h1>
  );
}

const foorILike = ['kim', 'park', 'choe'];

function renderFood(dish) {
  console.log(dish)
}

function App() {
  return (
    <div>
      {foorILike.map(renderFood)}
    </div>
  );
}

export default App;
